document.addEventListener("DOMContentLoaded", function() {

    console.log("INICIAJUAN");
    const generatePdfBtn = document.getElementById("generatePdfBtn");
  
    generatePdfBtn.addEventListener("click", function() {
     //const base64Data = "Tu_cadena_Base64_aqu√≠"; // Reemplaza esto con tu cadena Base64

      var base64Data = "";
  
      // Decodificar la cadena Base64
      const binaryData = atob(base64Data);
      const arrayBuffer = new ArrayBuffer(binaryData.length);
      const uint8Array = new Uint8Array(arrayBuffer);
      for (let i = 0; i < binaryData.length; i++) {
        uint8Array[i] = binaryData.charCodeAt(i);
      }
  
      // Crear un blob a partir de los datos decodificados
      const blob = new Blob([uint8Array], { type: "application/pdf" });
  
      // Crear un objeto URL para el blob
      const blobUrl = URL.createObjectURL(blob);
  
      // Crear un enlace para descargar el PDF
      const downloadLink = document.createElement("a");
      downloadLink.href = blobUrl;
      downloadLink.download = "documento.pdf"; // Nombre del archivo PDF
      document.body.appendChild(downloadLink);
  
      // Hacer clic en el enlace para iniciar la descarga
      downloadLink.click();
  
      // Limpiar despu√©s de la descarga
      URL.revokeObjectURL(blobUrl);
      document.body.removeChild(downloadLink);
    });
  });
  